	add("holder", "{\"term\":\"holder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|hold}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing that holds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Put your umbrella in the umbrella \u0027\u0027holder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who temporarily or permanently possesses something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s been an account \u0027\u0027holder\u0027\u0027 with us since 2004\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In 2012, there were 28 living \u0027\u0027holders\u0027\u0027 of the Victoria Cross or the George Cross\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who is employed in the hold of a vessel\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The defending champion\", \"priority\":7}]}, \"synonyms\":{}}");

