	add("holiday", "{\"term\":\"holiday\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Norwegian\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|holiday}}, {{m|enm|halidei}}, {{m|enm|haliȝdei}}, from Old english (ca. 450-1100) {{m|ang|haligdæd|hāliġdæġ|holy day, Sabbath}}, equivalent to {{compound|holy|day|lang\u003den}}. Cognate with West frisian {{m|fy|hjeldei||holiday}}, Danish {{m|da|helligdag||holiday}}, Norwegian {{m|no|helligdag||holiday}}, Swedish {{m|sv|helgdag||holiday, feast}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A day on which a festival, religious event, or national celebration is traditionally observed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Today is a Wiccan \u0027\u0027holiday\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A day declared free from work by the state or government\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A period of one or more days taken off work by an employee for leisure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A period during which pupils and students do not attend their school or university\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A period taken off work or study for travel or leisure.\u0026lt;!--belongs under \u0026quot;Derived terms\u0026quot;: \u0027To go on holiday\u0027, (a) to take time off work or study, (b) to travel and stay somewhere during a period taken off work or study for purposes of leisure or relaxation.--\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dNo matter how early I came down, I would find him on the veranda, smoking cigarettes, or. And at last I began to realize in my harassed soul that all elusion was futile, and to take such \u0027\u0027holidays\u0027\u0027 as I could get, when he was off with a girl, in a spirit of thankfulness\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A gap in coverage, e.g. of paint on a surface, or sonar imagery.\u0026lt;ref\u0026gt;Dictionary.com. Dictionary.com Unabridged (v 1.1). Random House, Inc. http://dictionary.reference.com/browse/holiday (accessed: June 26, 2007).\u0026lt;/ref\u0026gt\", \"priority\":8}]}, \"synonyms\":{}}");

