	add("holly", "{\"term\":\"holly\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"French\", \"Dutch\", \"scots\"], \"text\":\"From Middle english (1100-1500) \u0027holly\u0027 \u0027holi\u0027 \u0027holie\u0027 a shortened variation of \u0027holin\u0027 \u0027holyn\u0027 (\u0026gt; English dialectal \u0027hollen\u0027 \u0027holm\u0027 , from Old english (ca. 450-1100) {{m|ang|holeġn}}, \u0027holen\u0027 (holly; prince, protector) from Proto-germanic {{m|gem-pro|*hulisaz||butcher\u0027s broom}}, from Proto-indo-european {{m|ine-pro|*ḱol-||thorn, awn; a kind of thorny plant; prickly}}, from Proto-indo-european {{m|ine-pro|*ḱel-||to cut}}. Cognate with Scots \u0027holin\u0027 \u0027hollin\u0027 \u0027holyn\u0027 (holly) Dutch \u0027hulst\u0027 (holly) German \u0027hulst\u0027 (holly) French \u0027houx\u0027 {{gloss|\u0026quot;holly\u0026quot; \u0026lt; Germanic}}, Danish \u0027hylver\u0027 (holly) Welsh \u0027celyn\u0027 (holly) Russian \u0027ко́лос\u0027 (ear of wheat) Albanian \u0027kalli|lang\u003dsq\u0027 () Sanskrit \u0027कटम्ब|tr\u003dkaṭamba|lang\u003dsa\u0027 () Old Church Slavonic \u0027класъ|tr\u003dklasŭ|lang\u003dcu\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various shrubs or (mostly) small trees, of the genus \u0027Ilex\u0027, either evergreen or deciduous, used as decoration especially at Christmas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The wood from this tree\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several unrelated plant species likened to \u0027Ilex\u0027 because of their prickly, evergreen foliage and/or round, bright-red berries\", \"priority\":3}]}, \"synonyms\":{}}");

	add("holland", "{\"term\":\"holland\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old dutch\"], \"text\":\"From Old dutch {{m|odt||holt lant|wood land}}. A popular but false etymology holds that it is derived from \u0027\u0027 (hol land) inspired by the lowland|low-lying geography of both the Netherlands|Dutch and the English region (Wikipedia:Holland, Lincolnshire|Holland, Lincolnshire); the latter\u0027s name is derived from Old english (ca. 450-1100) \u0027lang\u003dang\u0027 (hoh land)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Netherlands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A region of the Netherlands formed by two provinces: \u0027North Holland\u0027 and \u0027South Holland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A historical region of Lincolnshire in England (also called \u0027Parts of Holland\", \"priority\":3}]}, \"synonyms\":{}}");

