	add("hollyhock", "{\"term\":\"hollyhock\", \"etymology\":{\"influencers\":[{},{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027holihoc\u0027 () from \u0027holi\u0027 (holy) + \u0027hoc\u0027 (mallow) \u0027hocke\u0027 (mallow) \u0027hokke\u0027 (mallow) (from Old english (ca. 450-1100) \u0027hoc\u0027 (marsh mallow) The modern hollyhock was probably unknown in England until the 15th century, so usage before then no doubt referred to some other mallow.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several flowering plants of the genus in the Malvaceae family\", \"priority\":1}]}, \"synonyms\":{}}");

