	add("holocaust", "{\"term\":\"holocaust\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027holocauste\u0027 from \u0027\u0027 from the neuter form of Ancient greek (to 1453) \u0027ὁλόκαυστος\u0027 from \u0027ὅλος\u0027 (whole) + \u0027καύστος\u0027 (burnt) from \u0027καίω\u0027 (i burn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sacrifice that is completely burned to ashes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1526\u0027\u0027, William Tyndale, trans. \u0027Bible\u0027, Mark XII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And to love a mans nehbour as hymsilfe, ys a greater thynge then all \u0027\u0027holocaustes\u0027\u0027 and sacrifises\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, Sir Thomas Browne, \u0027Pseudodoxia Epidemica\u0027, III.3\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"in the \u0027\u0027holocaust\u0027\u0027 or burnt-offering of Moses, the gall was cast away: for, as Ben Maimon instructeth, the inwards, whereto the gall adhereth, were taken out with the crop (according unto the law,) which the priest did not burn, but cast unto the east\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The annihilation or near-annihilation of a group of animals or people, whether by natural or deliberate agency\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"nuclear \u0027\u0027holocaust\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The state-sponsored mass murder of an ethnic group. In particular, the Holocaust (\u0027which see\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An inferno or fire disaster\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"a nuclear \u0027\u0027holocaust\", \"priority\":10}]}, \"synonyms\":{}}");

	add("holocaust", "{\"term\":\"holocaust\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"See \u0027holocaust\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The systematic mass murder (genocide) of 6 million Jews perpetrated by Nazi Germany shortly before and during World War II\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The systematic mass murder (democide) of 11 million people, namely 6 million Jews and 5 million others (including Romanis, Slavs, homosexuals, gender-nonconforming people and people with physical and mental disabilities), perpetrated by Nazi Germany shortly before and during World War II\", \"priority\":2}]}, \"synonyms\":{}}");

	add("hologenesis", "{\"term\":\"hologenesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"{{confix|holo|genesis|lang\u003den}}, from Italian \u0027ologenesi\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A theory of evolution in which each species divides into two, only one of which develops successfully\", \"priority\":1}]}, \"synonyms\":{}}");

